import React, { useEffect, useState } from "react";
import { motion } from "framer-motion";
import { FaGithub, FaLinkedin } from "react-icons/fa";

export default function Portfolio() {
  const [darkMode, setDarkMode] = useState(true);
  const [activeSection, setActiveSection] = useState("");

  useEffect(() => {
    document.documentElement.classList.toggle("dark", darkMode);
  }, [darkMode]);

  const sections = [
    { id: "about", label: "About" },
    { id: "experience", label: "Experience" },
    { id: "projects", label: "Projects" },
    { id: "education", label: "Education" },
    { id: "skills", label: "Skills" },
    { id: "contact", label: "Contact" }
  ];

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            setActiveSection(entry.target.id);
          }
        });
      },
      {
        rootMargin: "-50% 0px -40% 0px",
        threshold: 0,
      }
    );

    sections.forEach((section) => {
      const el = document.getElementById(section.id);
      if (el) observer.observe(el);
    });

    return () => observer.disconnect();
  }, []);

  return (
    <div className="flex min-h-screen bg-[#0a192f] text-slate-300">
      {/* Left Column - Hero & Nav */}
      <aside className="w-full md:w-2/5 lg:w-1/3 p-8 sticky top-0 h-screen flex flex-col justify-between border-r border-slate-700">
        <div>
          <h1 className="text-4xl font-bold text-white mb-2">Abijith Subramaniyan Kunnath</h1>
          <h2 className="text-xl text-teal-400 mb-4">Data Science Graduate</h2>
          <p className="text-slate-400 leading-relaxed">
            I build data-powered digital experiences for web and mobile. Passionate about ML, analytics, and elegant software solutions.
          </p>
        </div>

        <nav className="mt-8 space-y-3 font-mono text-sm">
          {sections.map((section) => (
            <a
              key={section.id}
              href={`#${section.id}`}
              className={`block font-mono text-sm transition ${
                activeSection === section.id
                  ? "text-white font-bold"
                  : "text-teal-400 hover:text-white"
              }`}
            >
              {section.label}
            </a>
          ))}
        </nav>

        <div className="mt-10 space-y-4">
          <div className="flex space-x-4 text-2xl text-slate-400">
            <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" className="hover:text-teal-400">
              <FaGithub />
            </a>
            <a href="https://linkedin.com/in/yourusername" target="_blank" rel="noopener noreferrer" className="hover:text-teal-400">
              <FaLinkedin />
            </a>
          </div>

          <button
            onClick={() => setDarkMode(!darkMode)}
            className="mt-4 bg-slate-800 text-white px-4 py-2 rounded-lg text-sm border border-slate-600 hover:bg-slate-700 dark:bg-slate-200 dark:text-slate-900 dark:hover:bg-slate-100"
          >
            {darkMode ? "Light Mode" : "Dark Mode"}
          </button>
        </div>
      </aside>

      {/* Right Column - Scrollable Sections */}
      <main className="w-full md:w-3/5 lg:w-2/3 overflow-y-auto">
        {sections.map((section, index) => (
          <motion.section
            key={section.id}
            id={section.id}
            className="max-w-2xl w-full mx-auto py-24 px-6"
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true, amount: 0.2 }}
            transition={{ duration: 0.6, delay: index * 0.05 }}
          >
            <h2 className="text-3xl font-bold mb-6 text-white">
              <span className="text-teal-400 font-mono">{String(index + 1).padStart(2, '0')}.</span> {section.label}
            </h2>

            {section.id === "about" && (
              <p className="text-lg leading-relaxed">
                Motivated and adaptable Data Science postgraduate with a background in Computer Science Engineering and experience in both IT and customer-facing roles. Seeking a Data Analyst or Data Science/Engineering position to apply analytical thinking, technical skills, and a strong work ethic to deliver impactful insights and grow in a dynamic, innovation-driven environment.
              </p>
            )}

            {section.id === "experience" && (
              <div className="space-y-6">
                <div>
                  <h3 className="text-xl font-semibold text-white">Systems Engineer, TCS (Chennai) | 2020–2022</h3>
                  <p>Maintained and updated retail datasets using Excel & SAP. Experience with ABAP, HANA, Retail modules. Used Jira for defect tracking and agile coordination.</p>
                </div>
                <div>
                  <h3 className="text-xl font-semibold text-white">Retail Assistant, BWS (Canberra) | 2023–Present</h3>
                  <p>Delivered customer service, assisted with purchases, managed inventory, ensured RSA compliance.</p>
                </div>
              </div>
            )}

            {section.id === "projects" && (
              <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                <div className="bg-[#112240] rounded-lg shadow-md p-6 hover:-translate-y-1 hover:shadow-teal-400 transition transform duration-300">
                  <h3 className="text-xl font-semibold text-white mb-2">TyireEye™ – Driving Conditions Warning App</h3>
                  <p className="text-slate-300 mb-2">Android app predicting hazardous conditions using BLE sensors and FastAPI ML models.</p>
                  <p className="text-sm text-teal-400">Kotlin · BLE · FastAPI · Python · Scikit-learn</p>
                </div>
                <div className="bg-[#112240] rounded-lg shadow-md p-6 hover:-translate-y-1 hover:shadow-teal-400 transition transform duration-300">
                  <h3 className="text-xl font-semibold text-white mb-2">MRI Age Estimation using PNN</h3>
                  <p className="text-slate-300 mb-2">PNN-based model with DWT + GLCM features for dental MRI age prediction. 93.3% accuracy.</p>
                  <p className="text-sm text-teal-400">Matlab · GLCM · DWT</p>
                </div>
              </div>
            )}

            {section.id === "education" && (
              <ul className="list-disc pl-5 space-y-2">
                <li>Masters in Data Science, University of Canberra (2023–2025)</li>
                <li>B.E. Computer Science, Velammal Engineering College (2016–2020)</li>
              </ul>
            )}

            {section.id === "skills" && (
              <div>
                <p className="mb-2 font-semibold">Skills:</p>
                <p className="mb-4">SQL, R, Power BI, Excel, HTML, CSS, SAP, ABAP, Java, Kotlin</p>
                <p className="mb-2 font-semibold">Certifications:</p>
                <ul className="list-disc pl-5 space-y-1">
                  <li>Microsoft Power BI Desktop</li>
                  <li>Web Dev Bootcamp by Dr. Angela Yu</li>
                  <li>SAP ABAP, SAP HANA</li>
                  <li>Study Australia Industry Experience</li>
                </ul>
              </div>
            )}

            {section.id === "contact" && (
              <div>
                <p>Email: abijith.subramaniyan@gmail.com</p>
                <p>Phone: 0430019454</p>
                <p>LinkedIn: <a href="https://www.linkedin.com/in/" className="text-teal-400 underline">Your LinkedIn</a></p>
              </div>
            )}
          </motion.section>
        ))}
      </main>
    </div>
  );
}
